import React from 'react';
import './task2.css';
class Task2 extends React.Component{
    change(){
        this.setState({message:"Hello"})
    }
    render(){
        return(
            <div>
                <h1 onClick={()=>this.change()} >Item1</h1>
                <h1>Item2</h1>
                <h1>Item3</h1>
                <h1>Item4</h1>
            </div>
        )
    }
}
export default Task2;
